import React from 'react';

class FoodNews extends React.Component{
    constructor(props){
        super(props);
    }
    render(){
        return(

        <div className="section__item">
          <h2>Food News</h2>
          {this.props.data.title}
        </div>
        )
    }
}

export default FoodNews;
